import React, { Component } from 'react';
import Axios from 'axios';

export default class Users extends Component {
  state = {
    user: null
  };

  componentDidMount() {
    Axios.get('https://jsonplaceholder.typicode.com/users/1')
      .then(response => {
        this.setState({
          user: response.data
        });
      })
      .catch(error => {
        console.log('error = ' + error);
      });
  }
}
